var title_f10_0_10252="Diagnostic criteria for CFS";
var content_f10_0_10252=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F50332&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F50332&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic criteria for the chronic fatigue syndrome",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Major criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. New onset of fatigue lasting six months, severe enough to reduce daily activity to less than 50 percent of the patient's premorbid activity level.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. The exclusion of other conditions that can produce fatigue.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Minor criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Symptom criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Low grade fever: temperature 37.5 to 38.6&deg;C orally or chills",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Sore throat",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3. Painful cervical or axillary lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4. Generalized muscle weakness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5. Muscle pain",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        6. Postexertional fatigue lasting more than 24 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        7. Generalized headaches",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        8. Migratory arthralgias",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        9. Neuropsychological complaints (photophobia, transient visual scotomata, forgetfulness, excessive irritability, confusion, difficulty thinking, inability to concentrate, or depression)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10. Sleep disturbance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        11. Acute onset of symptoms over a few hours to a few days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Physical criteria (determined by the physician on two occasions at least two months apart)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Low-grade fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Nonexudative pharyngitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3. Palpable cervical or axillary lymph nodes up to 2 cm in diameter",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
