var content_f10_0_10253=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F67816&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F67816&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Guidelines for determining a patient's fitness to drive",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Seizures",
"       </td>",
"       <td class=\"subtitle1\">",
"        Private drivers*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Single,",
"unprovoked seizure before a diagnosis",
"       </td>",
"       <td>",
"        Not drive for at least 3 mo and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Get neurological assessment, including EEG and CT scan",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        After epilepsy",
"diagnosis",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Drive if:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        12 months seizure free on medication&bull; and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Physician has insight into patient compliance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Physician caution against fatigue, alcohol",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        After surgery to prevent epileptic seizure",
"       </td>",
"       <td>",
"        Resume driving if 12 months seizure free after surgery&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Seizure in sleep or immediately upon awakening",
"       </td>",
"       <td>",
"        Drive if seizures only occur in sleep or upon awakening for at least 5",
"years (can reduce period if neurologist agrees)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\" rowspan=\"1\">",
"        Medication withdrawal or change:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        (a) Initial withdrawal or change",
"       </td>",
"       <td class=\"sublist_other\">",
"        Not drive for period of 3 months from the time medication has been",
"discontinued or changed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"1\" rowspan=\"2\">",
"        (b) If seizures",
"recur after withdrawal or change",
"       </td>",
"       <td class=\"sublist_other\">",
"        Resume driving if taking medication according to the physicians's",
"instructions and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist_other\">",
"        Seizure free for 6 months (can reduce period if neurologist agrees)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        (c) Long-term withdrawal and discontinuation of",
"medication",
"       </td>",
"       <td class=\"sublist_other\">",
"        Drive any vehicle if seizure free off medication for 5 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        Auras (simple",
"partial seizures)",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Drive if:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        No impairment in level of consciousness or cognition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Seizures are unchanged for more than 12 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Neurologist approves",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Alcohol-withdrawal",
"induced seizures",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Drive if:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Remain alcohol free and seizure free for 12 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Completed a recognized rehabilitation program for substance dependence",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Febrile or toxic convulsion",
"       </td>",
"       <td>",
"        No concern if fully recovered from illness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Syncope, sudden",
"falls",
"       </td>",
"       <td>",
"        Single, fully explained event: careful observation only",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Multiple, unexplained events: not drive until explained, corrected",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     EEG: electroencephalogram; CT: computed tomography.",
"     <br>",
"      * A private driver is one who drives less than 36,000 km a year, spends less than 720 hours a year behind the wheel, drives a vehicle weighing less than 11,000 kg and does not earn a living by driving.",
"      <br>",
"       &bull; Most private drivers with epilepsy resume driving after being seizure free for 12 months (irrespective of the treatment modality). This 12-month period may be reduced to 6 month on the recommendation of a neurologist.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Source: Canadian Medical Association: Determining medical fitness to drive. 6th ed. Ottawa: The Association; 2000. Reproduced with permission from: Blume WT. Diagnosis and management of epilepsy. CMAJ 2003; 168;441. Copyright &copy;2003 Canadian Medication Association.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
